import PropTypes from 'prop-types'

const Button = ({color , text}) => {
    return (
    <button onClick style={{backgroundColor: color}} className='btn'>{text}</button>
    )
}


Button.defaultProps = {
    color: 'steelblue',
    text: 'Add'
}
Button.propTypes = {
    color: PropTypes.string,
    text: PropTypes.string,  
}

export default Button
